import React from 'react';
import { Bar } from 'react-chartjs-2';

function DeviceChart({ devices }) {
  const data = {
    labels: devices.map(device => device.name),
    datasets: [{
      label: 'Water Flow (L/s)',
      data: devices.map(device => device.waterFlow),
      backgroundColor: 'rgba(255, 99, 132, 0.5)'
    }, {
      label: 'Pressure (psi)',
      data: devices.map(device => device.pressure),
      backgroundColor: 'rgba(54, 162, 235, 0.5)'
    }, {
      label: 'Temperature (°C)',
      data: devices.map(device => device.temperature),
      backgroundColor: 'rgba(255, 206, 86, 0.5)'
    }]
  };

  return <Bar data={data} />;
}

export default DeviceChart;
